import React from 'react';
import '../../App.css';
import Cards from '../Cards';
import HeroSection from '../HeroSection';
import Footer from '../Footer';
import Testimonials from '../Testimonials';
import Badges from '../Badges';


function Home() {
  return (
    <>
      <HeroSection />
      <Cards />
      <Testimonials />
      <Badges />
      <Footer />
    </>
  );
}

export default Home;
